import React from 'react';
import { Marker, Popup } from 'react-leaflet';

export default function PlaceMarker({ lat, lng, name }) {
  return (
    <Marker position={[lat, lng]}>
      <Popup>{name}</Popup>
    </Marker>
  );
}
